import Vue from 'vue';
import App from './App.vue';
import router from './router'; // Importe o arquivo de roteamento

Vue.config.productionTip = false;

new Vue({
  render: (h) => h(App),
  router, // Adicione o roteador à instância Vue
}).$mount('#app');
